import styled from "styled-components";
import { Avatar, TextDetail } from "../../container/style";

const Profile = () => {
	return (
		<>
			<LayoutProfile>
				<Profiles>
					<AvatarProfile />
					<ProfileDetails>
						<ProfileText>
							<TextDetail>
							<p>Name</p>
							<p>Darunporn</p>
						</TextDetail>
						</ProfileText>

					</ProfileDetails>
				</Profiles>
			</LayoutProfile>
		</>
	);
};
export default Profile;

const ProfileText = styled.div`
	margin: 50px 100px 20px 0;
`;
const LayoutProfile = styled.div`
	/* background-color: red; */
`;
const Profiles = styled.div`
	display: flex;
	flex-wrap: wrap;
	justify-content: center;
	background-color: gainsboro;
	width: 70%;
	margin: auto;
	height: 300px;
`;
const AvatarProfile = styled.div`
	background-color: green;
	width: 12rem;
	z-index: 1;
	border-radius: 100px;
	height: 12rem;
`;
const ProfileDetails = styled.div`
	background-color: yellow;
	border-radius: 50px;
	width: 100%;
	transform: translateY(-100px);
	height: 100%;
`;
